import React from 'react';
import DemoCard from '../components/demo/democard';
import '../../css/demo/demo.css';

export default class Blog extends React.Component {

  render() {
    return (
      <div className="main"  >
        <div className="main-container demo-container">
          <DemoCard name="中八台球平台" demo="http://axuebin.com/react-todolist" 
          src="https://github.com/xiaotao0902/" 
          img="https://s3.us-east-2.amazonaws.com/demos319840902/BILLIARD+BALL/dou8.png" />
        </div>
      </div>
    );
  }
}
